function logMessage(e,o){log(chalk`
  ${o}: {red ${e}}
  Time: {green ${(new Date).toString()}}
  `)}const log=console.log,chalk=require("chalk");var appLog={message:function(e){logMessage(e,"Message")},error:function(e){logMessage(e,"Error")},info:function(e){logMessage(e,"Info")},exception:function(e){logMessage(e,"Exception")}};module.exports=appLog;